g99ecdea97_1280-p-500.png 500w, images/network-g99ecdea97_1280-p-800.png 800w, images/network-g99ecdea97_1280-p-1080.png 1080w, images/network-g99ecdea97_1280.png 1280w\" alt=\"\">\n              <img src=\"images/internet-g5e90b9868_1920.jpg\" loading=\"lazy\" sizes=\"(max-width: 479px) 100vw, (max-width: 767px) 43vw, (max-width: 991px) 21vw, (max-width: 1439px) 22vw, 288px\" srcset=\"images/internet-g5e90b9868_1920-p-500.jpeg 500w, images/internet-g5e90b9868_1920-p-800.jpeg 800w, images/internet-g5e90b9868_1920-p-1080.jpeg 1080w, images/internet-g5e90b9868_1920-p-1600.jpeg 1600w, images/internet-g5e90b9868_1920.jpg 1920w\" alt=\"\">\n        <h2 data-w-id=\"d4c715e4-5202-7357-adaf-89c37dc2ede9\" style=\"-webkit-transform:translate3d(0, 48px, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 0);-moz-transform:translate3d(0, 48px, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 0);-ms-transform:translate3d(0, 48px, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 0);transform:translate3d(0, 48px, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 0);opacity:0\">Our Services</h2>\n          <img src=\"images/how-it-works-1.svg\" loading=\"lazy\" alt=\"\">\n            <h3>Data Analytics &amp; Machine Learning</h3>\n            We integrate all the pieces of the puzzle and funnel them through cloud tools, powered by a collaboration of big data tech and visualization tools, to deliver brilliant customer-facing reports with enhanced business insights.\n          <img src=\"images/icons8-data-transfer-48.png\" loading=\"lazy\" alt=\"\">\n            <h3>Data Engineering</h3>\n            The Symise Data Engineer expertise will help facilitate data pipelines using licensed proprietary ETL tools such as Glue, EMR, Databricks, Informatica, and open-source tools like Airflow.\n            <img src=\"images/icons8-web-apps-48.png\" loading=\"lazy\" alt=\"\">\n              <h3>Application Development &amp; System design</h3>\n              The Symise AppDev team will prove to be an asset to your project needs. With economical analytically-driven solutions Symise is way ahead of the competition. Get in touch with Symise solutions if you feel the need to stand-out in the ever-evolving software tech.\n          <img src=\"images/icons8-iot-50.png\" loading=\"lazy\" alt=\"\">\n            <h3>IOT &amp; Hardware Development</h3>\n            The Symise AppDev team will prove to be an asset to your project needs. With economical analytically-driven solutions Symise is way ahead of the competition. Get in touch with Symise solutions if you feel the need to stand-out in the ever-evolving software tech.<br><br><br>‍\n          <h2>Technologies and Tools</h2>\n            <img src=\"images/img-HardwareSoftware-Resale.jpg\" loading=\"lazy\" sizes=\"(max-width: 479px) 91vw, (max-width: 767px) 90vw, 567px\" srcset=\"images/img-HardwareSoftware-Resale-p-500.jpeg 500w, images/img-HardwareSoftware-Resale.jpg 750w\" alt=\"\">\n              <h2>Amazon Web Services</h2>\n              We use a blend of open-source and proprietary software to build sustainable and scalable solutions. We offer a wide variety of services such as Amazon Redshift, Lambda/Serverless, S3\n                <h2>Tools</h2>\n                  Symise’s data an analytics team integrates all the floating pieces within your cloud architecture to deliver customer facing reports for better business insights. We use BigQuery, AutoML.\n              <img src=\"images/technology-gf86078322_1920.jpg\" loading=\"lazy\" sizes=\"(max-width: 479px) 91vw, (max-width: 767px) 90vw, 567px\" srcset=\"images/technology-gf86078322_1920-p-500.jpeg 500w, images/technology-gf86078322_1920-p-800.jpeg 800w, images/technology-gf86078322_1920-p-1080.jpeg 1080w, images/technology-gf86078322_1920-p-1600.jpeg 1600w, images/technology-gf86078322_1920.jpg 1920w\" alt=\"\">\n            <img src=\"images/internet-g5e90b9868_1920.jpg\" loading=\"lazy\" sizes=\"(max-width: 479px) 91vw, (max-width: 767px) 90vw, 567px\" srcset=\"images/internet-g5e90b9868_1920-p-500.jpeg 500w, images/internet-g5e90b9868_1920-p-800.jpeg 800w, images/internet-g5e90b9868_1920-p-1080.jpeg 1080w, images/internet-g5e90b9868_1920-p-1600.jpeg 1600w, images/internet-g5e90b9868_1920.jpg 1920w\" alt=\"\">\n              <h2>Google Cloud Platform</h2>\n              Symise’s data an analytics team integrates all the floating pieces within your cloud architecture to deliver customer facing reports for better business insights. We use BigQuery, AutoML.\n              <h2>Testimonials</h2>\n                      <img src=\"images/handshake-g9d6bb4df5_1920.jpg\" loading=\"lazy\" sizes=\"64px\" srcset=\"images/handshake-g9d6bb4df5_1920-p-500.jpeg 500w, images/handshake-g9d6bb4df5_1920-p-800.jpeg 800w, images/handshake-g9d6bb4df5_1920-p-1080.jpeg 1080w, images/handshake-g9d6bb4df5_1920-p-1600.jpeg 1600w, images/handshake-g9d6bb4df5_1920.jpg 1920w\" alt=\"\">\n                          @Testimonial1\n                      &quot;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua&quot;.\n                      <img src=\"images/WhatsApp-Image-2022-05-11-at-1.37.35-PM.jpeg\" loading=\"lazy\" sizes=\"64px\" srcset=\"images/WhatsApp-Image-2022-05-11-at-1.37.35-PM-p-500.jpeg 500w, images/WhatsApp-Image-2022-05-11-at-1.37.35-PM-p-800.jpeg 800w, images/WhatsApp-Image-2022-05-11-at-1.37.35-PM-p-1080.jpeg 1080w, images/WhatsApp-Image-2022-05-11-at-1.37.35-PM.jpeg 1280w\" alt=\"\">\n                          @Testimonial2\n                      “Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua&quot;.  \n                      <img src=\"images/img-HardwareSoftware-Resale.jpg\" loading=\"lazy\" sizes=\"64px\" srcset=\"images/img-HardwareSoftware-Resale-p-500.jpeg 500w, images/img-HardwareSoftware-Resale.jpg 750w\" alt=\"\">\n                          @Testimonial3\n                      &quot;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua&quot;.\n                      <img src=\"images/avatar-2_1avatar-2.png\" loading=\"lazy\" alt=\"\">\n                          @sarahdaily\n                          89k followers\n                      “Easy to use and effective. I feel better knowing that I&#x27;m in control of who can see my data.”\n                      <img src=\"images/avatar-4_1avatar-4.png\" loading=\"lazy\" alt=\"\">\n                          @danielhankle\n                          122k followers\n                      “Love it! It&#x27;s helped me find new opportunities with some legit brands from all over the world.”\n                      <img src=\"images/avatar-3_1avatar-3.png\" loading=\"lazy\" alt=\"\">\n                          @styledbyjane\n                          47k followers\n                      &quot;This literally takes a few seconds to set up and is totally worth having.&quot;\n  <footer id=\"footer\">\n           Experience a smarter<br> <br>way with Symise Solutions\n      <a href=\"#\">Join Now</a>\n  </footer>\n      <a href=\"#\">Request Early Access</a>\n  <section id=\"contact-form\">\n      <h2>Contact form</h2>\n      <em>Fields marked with an asterisk (*) are required.</em>\n        <form id=\"wf-form-Contact-Form\" name=\"wf-form-Contact-Form\" data-name=\"Wf Form Contact Form\" method=\"get\">\n            <label for=\"First-Name\" id=\"contact-first-name\">First name *</label><input type=\"text\" maxlength=\"256\" name=\"First-Name\" data-name=\"First Name\" placeholder=\"\" id=\"First-Name\" required=\"\">\n            <label for=\"Last-Name\" id=\"contact-last-name\">Last name *</label><input type=\"text\" maxlength=\"256\" name=\"Last-Name\" data-name=\"Last Name\" placeholder=\"\" id=\"Last-Name\" required=\"\">\n            <label for=\"Email\" id=\"contact-email\">Email *</label><input type=\"email\" maxlength=\"256\" name=\"Email\" data-name=\"Email\" placeholder=\"\" id=\"Email\" required=\"\">\n            <label for=\"Contact-Phone-Number\" id=\"contact-phone\">Phone number</label><input type=\"tel\" maxlength=\"256\" name=\"Contact-Phone-Number\" data-name=\"Contact Phone Number\" placeholder=\"\" id=\"Contact-Phone-Number\">\n            <label for=\"Message\" id=\"contact-message\">Message</label><textarea data-name=\"Message\" maxlength=\"5000\" id=\"Message\" name=\"Message\" placeholder=\"\"></textarea>\n          <input type=\"submit\" value=\"Submit\" data-wait=\"Please wait...\">\n        </form>\n          Thank you! Your submission has been received!\n          Oops! Something went wrong while submitting the form.\n  </section>\n  <footer id=\"footer\">\n    <h1>Symise Solutions</h1>\n    <h2>Quick Links</h2>\n          <ul role=\"list\">\n            <li>\n              <a href=\"#\">Home</a>\n            </li>\n            <li>\n              <a href=\"#\">About</a>\n            </li>\n          </ul>\n          <a href=\"#\">Contact </a>\n          <ul role=\"list\">\n            <li>\n              <a href=\"#\">Machine Learning and Artificial Intelligence tools</a>\n            </li>\n            <li>\n              <a href=\"#\">support provided by Analytically.ai</a>\n            </li>\n          </ul>\n      Copyright © 2022 Symise Solutions. All rights reserved.\n  </footer>\n  <!-- [if lte IE 9]><![endif] -->\n  <style>\n.form-field {\n-webkit-appearance: none;\n}\n</style>\n</body>\n</html>', 'Elementor Landing Page #13', '', 'draft', 'open', 'open', '', '', '', '', '2022-05-23 11:53:10', '2022-05-23 11:53:10', '', 0, 'https://comptution.com/?post_type=e-landing-page&#038;p=13', 0, 'e-landing-page', '', 0);
